import logo from './logo.svg';
import Iframe from 'react-iframe'
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Ironsight - Systems Analysis and Design
        </p>
        <Iframe url="https://netdata.tylerharrison.dev/"
        width="99%"
        height="700px"
        id="myId"
        className="myClassname"
        display="initial"
        position="relative"
        frameBorder="0"/>
      </header>
    </div>
  );
}


export default App;
